import React from "react";
import styled from 'styled-components'
import SidebarItem from "./SidebarItem";

const SidebarParent = styled.div`
  background: #c34a36;
  width: 250px;
  height: 100vh;
`

function Sidebar() {
    return (
        <>
            <SidebarParent>
                <SidebarItem>
                    <p>Dashboard</p>
                </SidebarItem>
                <SidebarItem>
                    <p>Page 1</p>
                </SidebarItem>
                <SidebarItem>
                    <p>Page 2</p>
                </SidebarItem>
                <SidebarItem>
                    <p>Page 3</p>
                </SidebarItem>
            </SidebarParent>
        </>
    );
}

export default Sidebar;
